import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class App extends Component {
  constructor() {
    super()
    this.state = {
      momAge: 100
    }
  }

  handleChange = () => {
    this.setState
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p></p>
          <button>Click me!</button>
        </header>
      </div>
    );
  }
}

export default App;
